(lib.Control = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		var context = this;
		var game = this.parent;
		// botões
		var information = new lib.Information();
		var instruction = new lib.Instruction();
		var home = new lib.Home();
		var midiaOn = new lib.MidiaOn();
		var midiaOff = new lib.MidiaOff();
		var fullOn = new lib.FullOn();
		var fullOff = new lib.FullOff();
		
		information.name = "information";
		instruction.name = "instruction";
		home.name = "home";
		midiaOn.name = "midiaOn";
		midiaOff.name = "midiaOff";
		fullOn.name = "fullOn";
		fullOff.name = "fullOff";
		
		// lista dos botões em cada cena
		var openingButtons = [information, midiaOn, midiaOff, fullOn, fullOff];
		var gameButtons = [instruction, home, midiaOn, midiaOff, fullOn, fullOff];
		
		// utilizados para posicionar os botões
		var posY = 90;
		var inc = 90;
		var showing = false;
		var scene = "abertura";
		
		this.allowMidia = true;
		this.isFull = false;
		
		// Método que inicializa o componente
		this.init = function()
		{
			context.addChild(information, instruction, home, midiaOn, midiaOff, fullOn, fullOff);
			//setTimeout(arrangeMidiaButtons, 5);
			setTimeout(hideButtons, 10, context, false);
			// pega a cena atual
			scene = game.scene;
		}
		
		// Evento disparado quando o botão configurações é pressionado
		function configurationHandler(event)
		{
			//game.playSound("click");
			
			if (!showing)
				showButtons(this);
			else
				hideButtons(this);
		}
		
		// Mostra todos os botões
		function showButtons(container)
		{
			showing = true;
			
			var buttons = scene == "abertura" ? openingButtons : gameButtons;
			var index = 0;
			
			for (var i = 0; i < buttons.length; i++)
			{
				var button = buttons[i];		
				// botão que estará desabilitado
				var disabledMidiaButton = context.allowMidia ? "midiaOff" : "midiaOn";
				var disabledFullButton = context.isFull ? "fullOff" : "fullOn";
				
				var position = posY + inc * index; //(button.name == "midiaOff" ? i : button.name == "fullOff" ? i - 2 : i);
				
				// alpha do botão. 0 caso seja o botão de mídia que deve estar desabilitado
				var _alpha = button.name == disabledMidiaButton || button.name == disabledFullButton ? 0 : 1;
				createjs.Tween.get(button).wait(100).to({alpha:_alpha, y:position}, 250, createjs.Ease.quadOut);
				
				if (button.name != "midiaOn" && button.name != "fullOn")
					index++;
			}
			arrangeMidiaButtons();
			arrangeFullButtons();
		}
		
		// Esconde todos os botões 
		function hideButtons(container, ease = true)
		{
			showing = false;
			
			for (var i = 1; i < container.numChildren; i++)
			{
				var button = container.getChildAt(i);
				if (ease)
					createjs.Tween.get(button).wait(100).to({alpha:0, y:0}, 250, createjs.Ease.quadIn);//.call(removeButton, button);
				else
					button.alpha = 0;
			}
		}
		
		// Método responsável por organizar os botões de sons e música de modo a habilitar e desabilitar de acordo com as configurações prévias
		function arrangeMidiaButtons()
		{
			midiaOn.alpha = context.allowMidia ? 1 : 0;
			midiaOff.alpha = context.allowMidia ? 0 : 1;
		}
		// Método responsável por organizar os botões de fullscreen de modo a habilitar e desabilitar de acordo com as configurações prévias
		function arrangeFullButtons()
		{
			fullOn.alpha = context.isFull ? 1 : 0;
			fullOff.alpha = context.isFull ? 0 : 1;
		}
		
		// Disparado quando um dos botões de mídia é clicado
		function midiaHandler(event)
		{
			game.playSound("click");
			
			context.allowMidia = !context.allowMidia;
			
			game.toggleMusic();
			
			arrangeMidiaButtons();
			hideButtons(this);
		}
		
		// Instancia o objeto abertura ou envia comando para o parent fazer isso
		function homeHandler(event)
		{
			game.reinit();
			hideButtons(this);
		}
		// Instancia o objeto information ou envia comando para o parent fazer isso
		function informationHandler(event)
		{
			game.informe();
			hideButtons(this);
		}
		// Instancia o objeto instruction ou envia comando para o parent fazer isso
		function instructionHandler(event)
		{
			game.instruct();
			hideButtons(this);
		}
		// Altera o estado da tela entre fullscreen
		function toggleFull(event)
		{
			game.playSound("click");
		
			context.isFull = !context.isFull;
			
			game.toggleFullScreen();
			
			arrangeFullButtons();
			hideButtons(this);
		}
		
		this.init();
		
		// Registro do evento click nos botões
		this.configuracoes.on("click", configurationHandler, this);
		
		midiaOn.on("click", midiaHandler, this);
		midiaOff.on("click", midiaHandler, this);
		home.on("click", homeHandler, this);
		instruction.on("click", instructionHandler, this);
		information.on("click", informationHandler, this);
		fullOn.on("click", toggleFull, this);
		fullOff.on("click", toggleFull, this);
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// button
	this.configuracoes = new lib.botao_configuracoes_1();
	this.configuracoes.parent = this;
	new cjs.ButtonHelper(this.configuracoes, 0, 1, 1);

	this.timeline.addTween(cjs.Tween.get(this.configuracoes).wait(1));

}).prototype = getMCSymbolPrototype(lib.Control, new cjs.Rectangle(-45,-45,90,82), null);


