	this._txt2.name = "_txt2";
	this._txt2.textAlign = "center";
	this._txt2.lineHeight = 37;
	this._txt2.lineWidth = 43;
	this._txt2.parent = this;
	this._txt2.setTransform(-16.4,-31.7,1,1,-90);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this._txt2},{t:this._txt}]}).wait(1));

	// borda
	this.shape_1 = new cjs.Shape();
	this.shape_1.graphics.f().s("#CCCCCC").ss(0.5,1,1).p("AD6prInzAAQg8AAAAA8IAARfQAAA8A8AAIHzAAQA8AAAAg8IAAxfQAAg8g8AAg");

