	mask._off = true;
	mask.graphics.p("Aj5JsQg8AAAAg8IAAxfQAAg8A8AAIHzAAQA8AAAAA8IAARfQAAA8g8AAg");

	// fundo
	this.color = new lib.game_receivecolor();
	this.color.parent = this;

