			var positiveFeedback = "Parabéns!\n\n Você pintou corretamente.";
			
			var color = "#81E006";
			var total = 0;
			var nums = [];
			// variável booleana que delimita a marcação das peças
			var waitingPaint = true;
			
			var accuracy = 0;
			var ecount = 0;
